const WrapperEl = styled.div`
  width: 40rem;
  border: 1px solid salmon;
  padding: 2rem 1.5rem;
  height: 30rem;
`;

const Wrapper = (props)=>{
  return (
    <WrapperEl></WrapperEl>
  )
}

export default Wrapper;
